import React from "react";
import Header from "../../components/HomeHeader";
import Hero from "./sections/Hero";

const Home = () => {
  return (
    <main className="relative">
      <section className>
        <Header />
      </section>
      <section className>
        <Hero />
      </section>
      <section className>
        <svg width="1800" height="200" xmlns="http://www.w3.org/2000/svg">
          <g transform="rotate(-5 850 75)">
            <rect width="1700" height="75" x="50" y="75" fill="#6B8E23" />
            <text
              x="850"
              y="125"
              font-family="Arial"
              font-size="30"
              fill="white"
              text-anchor="middle"
            >
              ActiveAura ActiveAura ActiveAura ActiveAura
            </text>
          </g>
        </svg>
      </section>
    </main>
  );
};

export default Home;
